function playWord(array){
var randomIndex= (function ram(array){
   let minVal= 0;
   let MaxVal= array.length;
    let randomNumber = Math.floor(Math.random()*MaxVal)
    
if(randomNumber <= MaxVal &&  randomNumber >= minVal && randomNumber!== undefined){
 
 return randomNumber;
}else{
    ram(array);
}
})(array);


//console.log(answer);
if(level===0){
    if(array[randomIndex].length===3){
        answer= array[randomIndex];
    }else{
        playWord(memoryAry); 
    }
}else if(level===1){
    if(array[randomIndex].length===4){
        answer= array[randomIndex];
    }else{
        playWord(memoryAry); 
    }
}else if(level===2){
    if(array[randomIndex].length===5){
        answer= array[randomIndex];
    }else{
        playWord(memoryAry); 
    }
}else if(level===3){
    if(array[randomIndex].length===6){
        answer= array[randomIndex];
    }else{
        playWord(memoryAry); 
    }
}else if(level===4){
    if(array[randomIndex].length===7){
        answer= array[randomIndex];
    }else{
        playWord(memoryAry); 
    }
}else if(level===5){
    if(array[randomIndex].length===8){
        answer= array[randomIndex];
    }else{
        playWord(memoryAry); 
    }
}else if(5<level<=10){
    if(array[randomIndex].length===9){
        answer= array[randomIndex];
    }else{
        playWord(memoryAry); 
    }
}



}


